import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-intro',
  templateUrl: './intro.component.html',
  styleUrls: ['./intro.component.scss']
})
export class IntroComponent implements OnInit {
  name:string; 
  constructor() { }

  ngOnInit(): void {
    this.name="Vipin V Mathew";
  }

 
}
